import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/events">Event Management</Link>
        </li>
        <li>
          <Link to="/attendees">Attendee Management</Link>
        </li>
        <li>
          <Link to="/tasks">Task Tracker</Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
